import React, { useEffect } from "react";
import ReactDOM from 'react-dom';


export function City(data) {

    let city = "Desconhecido?";

    useEffect(() => {
        if(data.title !== undefined) {
            city = data.title;
        } else {
            city = "Desconhecido!";
        }
    }, []);

    console.log(data.title);

    return(
    <div>
        <p>{city}</p>
    </div>
    );
}
